import React from 'react';
import { HashRouter, Switch, Route } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <HashRouter>
      <Switch>
        <Route path="/" exact component={Work} />
      </Switch>
    </HashRouter>
  );
}

export default App;
